editor_4e4mz:
{"id":"4e4mz","title":"hihats","value":"import { sin } from '/dsp/osc/index.js'
import Reverb from '/dsp/freeverb/index.js'
import Stereoify from '/dsp/stereoify.js'
import Stutter from '/dsp/stutter.js'
import Hihat from './hihat'

export const channels = 2
export const bars = Infinity

export default async (context) => {
  const ch = await Hihat(context, 1/16, 350)
  const oh = await Hihat(context, 1/4, 124)
  const reverb = await Reverb(context)
  const stereoify = await Stereoify(context)
  const stutter = await Stutter(context, 4, 32)

  return mix => mix(
    t =>
      + ch(t)*(sin(t,6)*1)*2.8
      + oh(t+1/2)*3.7,
    t => ((t/4)%8<7) ? t.input : stutter(t),
    t => reverb(t, { feedback: .2, damp: .2, wet: .27 }),
    t => stereoify(t)
  )
}","controlEditor":{"id":"4e4mz"}}

editor_13kk2:
{"id":"13kk2","title":"basses","value":"import { saw, sin, sqr } from '/dsp/osc/index.js'
import Stereoify from '/dsp/stereoify.js'
import note from '/dsp/note/index.js'
import Bass from './bass'

export const channels = 2
export const bars = Infinity

const melody = [7,4,8].map(n => note(n+15))

export default async (context) => {
  const bass = await Bass(context, { melody })
  const stereoify = await Stereoify(context)

  return mix => mix(
    t => (t/4)%4 < 2 
      ? bass(t, { cut: 0.122 + sin(t, 1/128) * 0.060 })*.7 
      : bass(t, { cut: 0.102 + sin(t, 1/128) * 0.060 })*.75,
    t => stereoify(t)
  )
}","controlEditor":{"id":"13kk2"}}

