{"id":"3iew1","title":"textures-a","value":"import clip from '/dsp/softclip/index.js'
import { saw, sin, sqr } from '/dsp/osc/index.js'
import arp from '/dsp/arp.js'
import envelope from '/dsp/envelope/index.js'
import { Filter, lowpass, highpass } from '/dsp/biquad.js'
import note from '/dsp/note/index.js'
import slide from '/dsp/slide.js'
import Stereoify from '/dsp/stereoify.js'

const Melody = [1,3,33,55].map(n => note(n+15))

export const channels = 2
export const bars = Infinity

export default async (context) => {
  const lpf = await Filter(context)
  const hpf = await Filter(context)
  const hp = highpass(context, { cut: 360, res: 2.9 })
  const stereoify = await Stereoify(context)
  let n = 0
  return mix => mix(
    t => {
      n = slide(t*64, .002, .02, Melody)
      return 0
        + (0
        + saw(t, n) * .09
        + sqr(t, n*1.26) * .07
        // + saw(t*2, n*3.26) * .05
        )
        * envelope(t, 1/64, 100, 20) * 1.2
    },
    t => lpf(t, lowpass(t, { 
      cut: 600 + (540 * sin(t, 1/16)), 
      res: 5.99 
    })),
    t => hpf(t, hp), 
    t => stereoify(t),
  )
}
","controlEditor":{"id":"3iew1"}}

