editor_5de6f0:
{"id":"5de6f0","title":"bass","value":"import DiodeFilter from '/dsp/diodefilter/index.js'
import Wavetable from '/dsp/wavetable-osc/index.js'
import slide from '/dsp/slide.js'
import clip from '/dsp/softclip/index.js'
import arp from '/dsp/arp.js'

export default async (context, { 
  res = 0.88, 
  hpf = .003, 
  melody = Melody 
} = {}) => {
  const filter = new DiodeFilter()

  const osc = Wavetable(context, 'saw', 1024);
  const lfo = Wavetable(context, 'sin', 512);
  const lfo2 = Wavetable(context, 'sin', 512);

  let n = 0.0
  let synth_osc = 0.0
  let synth = 0.0

  return (t, { cut = 0.072, res = 0.68, hpf = .00009 } = {}) => {
    filter.res(res)
    filter.hpf(hpf)
    filter.cut(cut + lfo(1.33)*.0055)
    // ((lfo(1) * .6 + 1.2) / 2) 
  // * (0.370 + lfo2(.02) * 0.04))

    n = slide(t, 1/8, 2, melody)

    synth_osc = osc(n)
    synth = arp(t+.6, 1/2, synth_osc, 3, 2.15)

    synth = filter.run(synth * .6)
    synth = clip(synth * 5)

    return 0.5 * synth
  }
}
","controlEditor":{"id":"13kk2"}}

editor_ff941b:
{"id":"ff941b","title":"hihat","value":"import envelope from '/dsp/envelope/index.js'
import Wavetable from '/dsp/wavetable-osc/index.js'
import arp from '/dsp/arp.js'
import clip from '/dsp/softclip/index.js'

export default async (context, rate = 1/4, decay = 70) => {
  var hihat = 0
  var hihat_osc = Wavetable(context, 'noise', 15100, true)
  var hihat_delay = Array(100).fill(0)

  return t => {
    hihat = hihat_osc(1.35)
    hihat *= arp(t, rate, 220, 60, decay)
    hihat = clip(hihat, .71)
    hihat *= arp(t, 1/16, 12000, 12.6, 60)
    hihat_delay.push(-hihat)
    hihat_delay.shift()
    return (
      + hihat
      + hihat_delay[98] * .8
      + hihat_delay[69] * .7
      // - hihat_delay[25] * .5
      - hihat_delay[72] * .8
    ) * .3
  }
}","controlEditor":{"id":"4e4mz"}}

