{"id":"58il7","title":"pads","value":"import clip from '/dsp/softclip/index.js'
import { saw, sin, sqr, tri } from '/dsp/osc/index.js'
import arp from '/dsp/arp.js'
import envelope from '/dsp/envelope/index.js'
import Moogladder from '/dsp/moogladder.js'
import note from '/dsp/note/index.js'
import slide from '/dsp/slide.js'
import Stereoify from '/dsp/stereoify.js'
import { Filter, lowpass, highpass } from '/dsp/biquad.js'
import Reverb from '/dsp/impulse-reverb.js'

const tp = 20
const melody = [
  [3,8,11].map(n => note(n+tp)),
  [7,10,14].map(n => note(n+tp)),
]

export const channels = 2
export const bars = 2

export default async (context) => {
  const filter = await Moogladder(context)
  const stereoify = await Stereoify(context)
  const hpf = await Filter(context)
  const hp = highpass(context, { cut: 260, res: .4 })
  const reverb = await Reverb(context, '/samples/impulses/r1_omni_48k.wav')
  // const reverb = await Reverb(context, '/samples/impulses/terrys_warehouse_omni.wav')
  // const reverb = await Reverb(context, '/samples/impulses/falkland_tennis_court_omni.wav')

  let c = [0,0,0]
  return mix => mix(
    t => {
      c = melody[(t/4)%2|0]
      return 0
        + (0
        + saw(t, c[0]/2) * .01
        + saw(t, c[0]) * .04
        + saw(t, c[1]/2) * .02
        + saw(t, c[1]) * .03
        + saw(t, c[2]/2) * .03
        + saw(t, c[2]) * .04
        // + saw(t, c[2]) * .07
        // + saw(t*2, n*3.26) * .05
        )
        * (1-envelope(t+1/2, 1/4, 3, 9)) * 2.2
        * (envelope(t+1/8, 1/3, 5.5, 2)) * 1
    },
    t => filter(t, filter.set({ 
      cut: 4650, //600 + sin(t, 1/16) * 400, 
      res: .8, 
      sat: 1 
    }))*1.5,
    t => reverb(t,.42), 
    t => hpf(t, hp),
    t => stereoify(t),
  )
}
","controlEditor":{"id":"58il7"}}

editor_4bj6j:
{"id":"4bj6j","title":"vocals","value":"import fetchSample from '/dsp/fetch-sample.js'
import resample from './resample'
import Reverb from '/dsp/impulse-reverb.js'
import Stutter from './stutter'
import Delay from '/dsp/delay.js'

export const bars = Infinity

export default async (context) => {
  // http://ccmixter.org/content/MissJudged/MissJudged_-_The_World_Ends.mp3')
  const reverb = await Reverb(context, '/samples/impulses/r1_omni_48k.wav')
  const stutter = await Stutter(context, 1/4, 8)
  const delay = await Delay(context)
  const vocal = await fetchSample('/samples/vocals/MissJudged_-_The_World_Ends.mp3')

  let begin 
  begin = msToSamples(context, 180)
  const vocal_part_1 = vocal.subarray(
    begin, 
    begin + context.lengths.bar*2
  )
  begin = msToSamples(context, 3580)
  const vocal_part_2 = vocal.subarray(
    begin, 
    begin + context.lengths.bar*2
  )
  const vocals = [vocal_part_1, vocal_part_2]
  return mix => mix(
    t => resample(t, vocals[((t/8)%2)|0], 1.12)*1.5,
    t => {
      return t.input + delay(t, {
        feedback: .9,
        delay: Math.floor(
          (1/[2,4,64,128,4,16,32,64][Math.floor((t*4)%8)]) 
        * context.lengths.bar/2)
      })*.6
    },
    t => stutter(t),
    t => reverb(t, .12),
  )
}

const msToSamples = ({ sampleRate }, ms) => {
  return Math.floor(sampleRate / 1000 * ms)
}
","controlEditor":{"id":"4bj6j"}}

