{"id":"13212f","title":"stutter","value":"export default async (context, d = 1, s = 32) => {
  const bar = context.totalLength
  const add = []
  for (let x = 0; x < 1000; x++) {
    add.push((((Math.random() * s | 0)/s) * bar) | 0)
  }
  let i = 0
  return t => t.output[0][((i++ % Math.floor(bar/d)) +
    (add[(t*1) % add.length | 0])
  ) % bar]
}
","controlEditor":{"id":"4bj6j"}}

editor_5v25k:
{"id":"5v25k","title":"snare","value":"import clip from '/dsp/softclip/index.js'
import { sin, tri, sqr } from '/dsp/osc/index.js'
import Wavetable from '/dsp/wavetable-osc/index.js'
import envelope from '/dsp/envelope/index.js'
import arp from '/dsp/arp.js'
import Reverb from '/dsp/freeverb/index.js'
import Stutter from '/dsp/stutter.js'

export const bars = Infinity

export default async (context) => {
  const reverb = await Reverb(context)
  const stutter = await Stutter(context, 1, 16)
  var snare = 0
  var snare_osc = Wavetable(context, 'noise', 5000, true)
  var snare_delay = Array(60).fill(0)

  return mix => mix(t => {
    snare =0
      + sqr(t, 225) * .7
      //+ tri(t, bassline[2]*4 + sin(t, 30) * .04) * 2.3
    snare *= arp(t, 1/4, 20, 40, 40) * 1.2
    snare += snare_osc(3.1) * 3.8
    snare =
      + snare * envelope(t+1, 1/2, 17.67, 5) * .3
      + snare * envelope(t+1, 1/2, 90, 5) * 1.2
      + snare * envelope(t+1, 1/2, 40, 40) * 1.1
    snare *= .12
    snare_delay.push(-snare)
    snare_delay.shift()

    return clip(0
      + snare
      // + snare_delay[47] * .3
      + snare_delay[55] * .2
      + snare_delay[2] * .4
      , .25) * .23
  },
  t => ((t/4)%8<7) ? t.input : stutter(t),
  t => reverb(t, { feedback: .7, damp: .4, wet: .5 })*2.5,
  )
}","controlEditor":{"id":"5v25k"}}

