{"id":"main","title":"main","value":"import reverse from '/dsp/reverse.js'
import Spin from '/dsp/spin.js'
import sof from '/dsp/sample-of.js'

export default async (context) => {
  const spin = await Spin(context, 0.0191, .078)
  let x = 0, y = 0
  return mix => mix(
    t => {
      const b = t.buffers
      x = y = 0
      x += sof(b.kicks[0], t.n)
      x += sof(b.hihats[0], t.n)
      x += sof(b.snare[0], t.n)*.7
      // x += sof(b.basses[0], t.n)*.6
      x += sof(b.pads[0], t.n*.6)*.6
      y += x

      x += sof(b.vocals[0], t.n*.5)*.5
      y += sof(b.vocals[0], t.n*.5)*.5

      return [x,y]
    },
    // t => reverse(t),
    // t => spin(t),
  )
}
","controlEditor":{"id":"main"}}

